import axios from "axios";


 export default{
    createGame: (gameName) => {
        // console.log("Running the browser");
        axios.post("/api/newgame", {gameName: gameName})
        .then(result => {
            // console.log(result);
            return result.data._id;
        });
    }
 };//END export default
